using System.Collections;
using System.Collections.Generic;
using UnityEngine;

public class FoodOption
{

    public string id;
    public string name;
    public string url = "https://www.daskochrezept.de/sites/default/files/styles/43l/public/rezepte/2010/3/Pizza-Margherita-4bb0ecf864075.jpg?itok=DTfMNXj9";

    private string base64Image = "";

    

    public Texture2D GetTexture(){
        Texture2D texture = new Texture2D(1,1);
        byte[] imageData = System.Convert.FromBase64String(base64Image);
        texture.LoadImage(imageData);
        texture.Apply();
        return texture;
    }
}
